              <CardItem />
            </Grid>
          </Grid>
        </Container>
      </div>
    );
  }
  componentDidMount() {
    axios({
      url:
        "http://elearning0706.cybersoft.edu.vn/api/QuanLyKhoaHoc/LayDanhSachKhoaHoc?MaNhom=GP01",
      method: "GET",
    })
      .then((res) => {
        console.log(res);
